import React from 'react';
import classes from './Register.module.css'
import { Img } from '../AllPng/AllPng.tsx'


const Register = () => {

	return (

		<div className={classes.Register}>
    <div><Img id="Logo" /></div>
		<div>
		<div><Img/></div>
		</div>
		</div>
	)
 
 }




export default Register;
